import styled from "styled-components";

export const Wrapper = styled.div `
	{	
		display: flex;
		margin: 20px auto;
		font-size: 1em;
		width: 100%;
		height: 2.5em;
		position: absolute;
        top: 0;
        left: 0;
        text-align: center;
	}
`;

export const Logga = styled.div `
	{
		padding-left: 20px;
		font-size: 1.3em;
		width: 50%;
		height: 2.5em;
		position: relative;
        text-align: left;

		@media screen and (max-width: 650px) {

			display: none;

		  }
	}
`;



